function countProgramsPart1(id, programList) {
    let programCount = {};

    if (programList[id]) {
        programCount[id] = true;
        traceConnections(id);

        function traceConnections(id) {
            programList[id].communicatesDirectlyWith.forEach(connectedProgramId => {
                if (!programCount[connectedProgramId]) {
                    programCount[connectedProgramId] = true;
                    traceConnections(connectedProgramId);
                }
            });
        }
    }

    return Object.keys(programCount).length;
}

function countGroupsPart2(programList) {
    let groupCount = {};

    programList.forEach((program, id) => {
        console.log('program', program, id);

        if (!alreadyAddedAsGroup(id)) {
            addAsNewEmptyGroup(id);
            traceGroupConnections(id);
        }
    });

    return Object.keys(groupCount).length;

    ///////////////////////////////////////////////////
    function addAsNewEmptyGroup(id) {
        groupCount[id] = {connectedPrograms: {[id]: true}};
    }

    function alreadyAddedAsGroup(id) {
        for (let group in groupCount) {
            if (groupCount[group].connectedPrograms[id]) {
                return true;
            }
        }
        return false;
    }

    function traceGroupConnections(groupId) {
        findAllConnectingPrograms(groupId);

        function findAllConnectingPrograms(id) {
            programList[id].communicatesDirectlyWith.forEach(connectedProgramId => {
                if (!groupCount[groupId].connectedPrograms[connectedProgramId]) {
                    groupCount[groupId].connectedPrograms[connectedProgramId] = true;
                    findAllConnectingPrograms(connectedProgramId);
                }
            });
        }
    }
}

